import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Nav from 'react-bootstrap/Nav';

import {
    NavLink
} from "react-router-dom";

function ReactNavbar(props){
    return(
        <>
            <nav className="navbar bg-dark navbar-dark">
                <div className="container-fluid">
                    <div className="navbar-header">
                        <a className="navbar-brand" href="#">WebSiteName</a>
                    </div>
                    <ul className="navbar-nav">
                        {/* { */}
                            {/* props.routes.map((value, index) => (
                                <li key={index}>
                                    <NavLink className="nav-link" to={`${value['route']}`}>
                                        {value['name']}
                                    </NavLink>
                                </li>
                            )) */}
                            <li className="nav-item"><NavLink to="/">Home</NavLink></li>
                            <li className="nav-item"><NavLink to="/extract">Extract</NavLink></li>
                            <li className="nav-item"><NavLink className="nav-item" to="/files">Files</NavLink></li>
                        {/* } */}
                    </ul>
                </div>
            </nav>
            {/* <Navbar bg="dark" variant="dark" className="navbar">
                <Navbar.Brand href="/">Navbar</Navbar.Brand>
                <Nav className="mr-auto navbar-nav" >
                        {props.routes.map((value, index) => (
                            <NavLink className="nav-link" key={index} to={`${value['route']}`}>{value['name']}</NavLink>
                        ))
                        }
                </Nav>
                
                <Form inline>
                    <Button variant="outline-light">Username</Button>
                </Form>
                
            </Navbar> */}
            
        </>
    );
}

export default ReactNavbar;
